description:
Ocean Predators (LBFilms)

Nature Documentary hosted by Glen McGready, published by Los Banditos in 2013 - English narration


Information
------------------------------

Ocean Predators Immerse yourself deep into the ocean in search of the most dangerous predators in our seas. Unveil the mysteries of these fascinating and skilled hunters. Razor-sharp teeth and lightning-fast reactions rule in this unforgiving environment where eels and dogs perform underwater maths.

